Ванная комната имеет для нас особое значение. Если предполагается произвести ремонт в квартире, то именно ванную комнату хочется отремонтировать так, чтобы она всегда сверкала чистотой, была уютной и комфортной.

Выбор строительных материалов на рынке поистине огромный. Чтобы не растеряться в богатстве предложений, необходимо определиться с приоритетами, что мы хотим получить и за какие деньги.

Основное требование к отделочным материалам ванной – их повышенная влагостойкость и водонепроницаемость. Таким образом, круг отделочных материалов сужается. Основной выбор может быть произведён между панелями ПВХ и кафелем.

Отделка кафелем – дорогой вариант ремонта, Желательно, чтобы укладку кафеля производил специалист. Более дешёвый вариант – использование для отделки панелей из ПВХ. С работой может справиться специалист не очень высокой квалификации, даже, начинающий, если чётко следовать инструкциям. При качественно выполненной работе ванная будет выглядеть не менее достойно, чем с кафельными стенами.

Рассмотрим основные преимущества использования панелей из ПВХ для отделки:  
\- лёгкость, прочность, влагостойкость;  
\- легко поддаются гигиенической обработке;  
\- декоративный внешний вид, ассортимент продукции допускает возможность приобретения панелей любой цветовой гаммы, а также панелей с рисунками;  
\- вариант достаточно экономичный;  
\- простота монтажа без использования дорогих инструментов;  
\- панели не теряют эксплуатационных свойств в условиях повышенной влажности и парообразования;  
\- панели ПВХ в условиях эксплуатации экологически безвредны; опасность выделения вредных веществ может появиться только при пожаре;  
\- панели из ПВХ не поддерживают горения, но плавятся, выделяя токсичные газы.  
К отрицательным свойствам этого отделочного материала можно отнести:  
\- специфический запах новых панелей, который со временем уходит;  
\- чувствительность к ударным воздействиям.

Маленькую ванную комнату можно зрительно сделать объёмнее, используя светлые пастельные тона, большая комната будет выглядеть гораздо уютнее с цветом стен более насыщенных оттенков.

При монтаже панелей вам помогут следующие рекомендации:  
• Панели крепятся на обрешётку.  
• Первая панель закрепляется в самом дальнем углу комнаты.  
• Крепить панели к стене можно клеем или саморезами. Следует помнить, что использование клея даёт трудно разъёмное соединение.  
• Панели плотно прижимаются друг к другу.  
• Для декоративного оформления стыков имеются специальные уголки.  
• Между панелью и полотенцесушителем необходимо оставить зазор, так как от высокой температуры панель может деформироваться.

**Вентиляция подпольного пространства** необходима, так как она выполняет ряд важных задач. Прежде всего, вентиляция пола предотвращает скапливание влаги, появление грибка и плесени, а так же препятствует гниению дерева. Как следствие, вентиляция подпольного пространства защищает человека от заболеваний связанных с распространением грибка и плесени, а так же предотвращает скапливание и проникновение подземного газа в помещение.

Основные **требования к системам подпольной вентиляции**

Ряд требований к системам подпольной вентиляции состоит из:  
1) Площадь всех вентиляционных отверстий в подполе должна быть равна 0,25% от площади всего подпола;  
2) Каждое **вентиляционное отверстие** должно иметь размеры от 0,04 м2 до 0,06 м2;  
3) В зависимости от уровня выпадающего снега на улице зависит высота расположения приточных и вытяжных вентиляционных отверстий. При этом оба продуха должны располагаться друг напротив друга, но приточный продух должен быть ниже, чем вытяжной, на 15см;  
4) Если  в подполе есть внутренние перегородки необходимо сделать продухи и в них;  
5) Каждое **вентиляционное отверстие** нужно закрыть мелкой сеткой для защиты от грызунов;  
6) Если подпол невысокий, тогда циркуляция воздуха происходит за счет вентиляционных отверстий в полу у стен.

**Способы обеспечения вентиляции**

Существует естественный вид вентиляции и принудительный.  
Естественная **вентиляция подпольного пространства** является недорогим, но эффективным вариантом. Такая вентиляция не зависит от наличия электричества и функционирует непрерывно за счет естественных потоков воздуха с улицы.

**Принудительный тип вентиляции** используют в низинах, когда снаружи нет притока воздуха. В таких случаях устанавливаются 2 или 3 вентилятора, которые и осуществляют вентиляцию.

Укладка декоративных плит на стену – занятие трудоёмкое и имеет свои тонкости, которые необходимо учитывать при выполнении работ.

Очень важно определить до начала работы, какое качество имеет поверхность стены. Она должна быть идеально ровной и зачищенной, до такой степени, чтобы слой клея ложился ровно и не вступал в реакцию с посторонними примесями, обеспечивая хорошее сцепление плит со стеной.

Чтобы отделка помещения получилась качественной, необходимо соблюдение некоторых условий:  
\- поверхность стен должна быть ровной и гладкой;  
\- помещение, в котором решено произвести ремонт, избавляют от грязи и пыли;  
\- в случае необходимости на некоторые части поверхности наносят металлические сеточки, насечки;  
\- плитка предварительно моется и сушится.

Поскольку идеально ровные стены практически не встречаются, а штукатурка достаточно трудоёмкий способ выравнивания стен, то оптимальным вариантом будет способ выравнивания стен с помощью гипсокартона. Даже, если на поверхности значительные неровности – перепады в пределах 5-7 мм, то лист гипсокартона вполне закроет эти дефекты поверхности. Использование для выравнивания стен гипсокартон – экономичный и надёжный вариант подготовки к укладке плит.

Процесс выравнивания стен под плитку с помощью гипсокартона выглядит следующим образом:  
\- лист гипсокартона устанавливается по профилю;  
\- выравнивается с помощью уровня;  
\- пропитывается грунтовкой:  
\- покрывается тонким (около 3 мм) слоем штукатурки:  
\- поверхность тщательно зачищается;  
\- листы гипсокартона закрепляются на стене.
